import React from 'react';
import ScriptNavigator from './ScriptNavigator';

function ScriptNavigatorPage() {
  return (
    <div className="container mx-auto p-4">
      <h1 className="text-2xl font-bold mb-4">Script Navigator</h1>
      <ScriptNavigator />
    </div>
  );
}

export default ScriptNavigatorPage;
